import {Link} from "react-router-dom";
import './defaultpage.css';
import mainPic from '../Images/mainPic.jpg';


export function DefaultPage() {

    return (
        <div>
            <div className="defaultPageBox">
                <div className="card-h">
                    <img
                        className="card-img-top mx-auto mt-4"
                        src={mainPic}
                        alt="Card "
                    />
                    <div className="card-body">
                        <h5 className={`card-title `}>
                            App Development
                        </h5>
                        <p className={`card-text `}>
                            Bringing ideas to life through mobile apps, blending code,
                            design, and user-centrnnnnnnnnnnnnnnnnnnic functionality.
                        </p>
                    </div>
                </div>



            </div>


        </div>
    );
}
